def getDistMutants():
    res = {}
    distSampleDir = Path('/home/xxx/research/mutd4j/resample/mutatorDistribution/results')
    for file in distSampleDir.iterdir():
        if not file.name.endswith('.txt'):
            continue
        mutator = file.stem
        if mutator not in res:
            res[mutator] = []
        with file.open() as f:
            for line in f:
                res[mutator].append(line.strip())
    return res



